import React from 'react'
import CtaButton from './CtaButton';
import SmallHeading from './SmallHeading';
import blockchain from '../../image/12476380705.png';
import "MainContent.css"

function MainContent() {
    return (
            <div className="MainContent">
                <div className="left">
                    <SmallHeading title={'Leading with simplicity and intelligence'} identifier={'Before'} />
                    <h1>
                        Developer Student Club (IVE) <span className='GradientText'><br /></span>
                    </h1>
                    <p>
                        By Google Developers
                    </p>
                    <div className="btns-con">
                        <CtaButton name={'discover more'} />
                    </div>
                </div>
                <div className="right">
                    <img src={blockchain} alt="" />
                </div>
            </div>
    )
}


const MainContentStyled = styled.div`
    position: absolute;
    top: 40%;
    left: 50%;
    transform: translateX(-50%);
    width: 80%;
  
    .content{
        display: contents;
        grid-template-columns: repeat(2, 1fr);
        height: 100%;
        width: 100%;
       color: white;
        .left{
          height: 100%;
          flex: 50%;
          max-width: 600px;
            h1{
                padding: 1.8rem 0;
            }
            .btns-con{
                margin-top: 3rem;
            }
        }

        .right{
            
              height: 100%;
              flex: 50%;
              display: flex;
              flex-direction: column;
              justify-content: center;
              float: right;
          
        }
    }
`;
export default MainContent;
